import React from 'react';

class About extends React.Component{
	render(){
		return(
	  	 React.createElement(
	  	 	"h2", 
	  	 	{ classname: "title"},
	  	 	"Welcome to Next.js!"
	  	 	)
	  	)
	}
}
export default About;
